import React from 'react';

function StateTable() {
    return (

        <div className="container" style={{
                margin: "auto",
                width: "75%",
                paddingTop: "60px"
              }}>
            <div className="row">
                <div className="col-6" style={{
                    textAlign: "left",
                    padding: "6px",
                    height: "40px",
                    backgroundColor: "#3F51B5",
                    color: "#ffffff"
                }}>Processes' State</div>
                <div className="col-6" style={{
                    textAlign: "left",
                    padding: "6px",
                    height: "40px",
                    backgroundColor: "#65C982",
                    color: "#ffffff"
                }}>Queue's State</div>
                <div className="col-3" style={{
                    textAlign: "left",
                    padding: "6px",
                    height: "80px",
                    color: "#000000",
                    border: "1px solid grey"
                }}>Active Processes</div>
                <div className="col-3" style={{
                    textAlign: "left",
                    padding: "6px",
                    height: "80px",
                    color: "#000000",
                    border: "1px solid grey"
                }}>Failed Processes</div>
                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
            </div>
        </div>

    )
}

export default StateTable;
